import React from 'react';
import { useNavigate } from "react-router-dom";

function logOut(){
  const navigate = useNavigate();
  navigate('/login');
}

const Logout = () => {
  return (
    <button onClick={logOut}>Logout</button>
  )
}

export default Logout;
